pub fn world(difficulty: Difficulty) -> World {
    let mut world = World::default();
    world.regions = regions();
    match difficulty {
        Difficulty::Easy => {
            world.year = 1990;
            world.extinction_rate = 0.0;
            world.temperature = 0.39;
        },
        Difficulty::Normal => {
            world.year = 2022;
            world.extinction_rate = 0.0;
            world.temperature = 1.289;
        },
        Difficulty::Hard => {
            world.year = 2035;
            world.extinction_rate = 0.0;
            world.temperature = 1.623;
        }
    }
    world
}


